import styled from 'styled-components';

export const UserList = styled.div`
  overflow: scroll;
  height: calc(100vh - 164px);
  margin: 1px 3px 0px 8px;
`;
export const ListGrid = styled.div`
  &.hide {
    display: none;
  }
`;
